  \"2015-01-16T20:18:45.128244\",\n\t\"name\": \"tiger-line-shapefile-2012-series-information-file-for-the-current-county-subdivision-state-base\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. County subdivisions are the primary divisions of counties and their equivalent
  entities for then               reporting of Census Bureau data, and they include
  legally minor civil divisions (MCDs) and statistical census county divisions (CCDs),
  and unorganizedn               territories. For the 2010 Census, the legal MCDs
  are the primary governmental and/or administrative divisions of counties in 29 States
  and Puerto Rico;n               Tennessee changed from having CCDs for Census 2000
  to having MCDs for the 2010 Census. In MCD States where no MCD exists or is not
  defined, the Censusn               Bureau creates statistical unorganized territories
  to complete coverage. The entire area of the United States, Puerto Rico, and the
  Island Areas isn               covered by county subdivisions. The boundaries of
  all 2010 Census legal MCDs are as of January 1, 2010 as reported through the Census
  Bureau's Boundaryn               and Annexation Survey (BAS). For the 2010 Census,
  CCDs or their equivalents are delineated in 21 States. The boundaries of all 2010
  Census statisticaln               CCDs were delineated as part of the Census Bureau's
  Participant Statistical Areas Program (PSAP).\",\n\t\"license_title\": null,\n\t\"extras\":
